Etkinlik Kuralları:
1. Gashapon etkinliğine katılın ve kalıcı görünüm ve görünüm parçaları gibi nadir ödüller kazanma fırsatı yakalayın.Ödül havuzu zaman zaman güncellenecektir;
2. Görünüm parçaları, parça mağazasında kalıcı görünüm ve diğer aksesuarlarla değiştirilebilir; parça mağazası arasıra güncellenecektir
3. Halihazırda sahip olduğunuz (kalıcı olarak elde ettiğiniz) görünümler, gashapon'da tekrar elde edilmeyecektir;
4. Etkinliği yorumlama hakkı resmi Mini World'a aittir.

Etkinlik Kuralları:
 1. Gashapon etkinliğine katılın ve kalıcı giydirme ve giydirme parçaları gibi nadir ödüller kazanma fırsatı yakalayın.Ödül havuzu zaman zaman güncellenecektir;
 2. Giydirme parçaları, zaman zaman güncellenecek olan parça dükkanında kalıcı giydirme ve diğer aksesuarlarla değiştirilebilir;
 3. Halihazırda sahip olduğunuz (kalıcı olarak elde ettiğiniz) kostümler, gashapon'da tekrar tekrar elde edilmeyecektir;
 4. Etkinliği yorumlama hakkı resmi Mini World'e aittir.

Lütfen oyundaki kuralları ihlal eden bilgileri yayınlamayın veya yaymayın. İhlalatörler ciddi şekilde ele alınacaktır.
İhlal içeriği içerir ancak bunlarla sınırlı değildir--
1. Kişisel Gizlilik Bilgisi: Hesap şifresi, gerçek isim vb. Gibi.
2. İndükleme Bilgileri: Şarj alımları, bağlantı indirmeleri vb. Gibi.
3. Sosyal bilgiler: sosyal platformlar, iletişim bilgileri, web sitesi bağlantıları vb. Gibi.
4. Ulusal yasaları ve düzenlemeleri ihlal eden içerik:
 (1) Anayasanın kurduğu temel ilkeleri ihlal etmek;
 (2) Ulusal güvenliği tehlikeye atarak, devlet sırlarını, devlet gücünü incelemek ve ulusal birliğin baltalanması;
 (3) Ulusal onur ve çıkarlara zarar vermek;
 (4) etnik nefret, etnik ayrımcılığa ve etnik birliğin baltalanması teşvik etmek;
 (5) Devletin dini politikalarını baltalamak ve kültleri ve feodal batıl inançları teşvik etmek;
 (6) söylentileri yaymak, sosyal düzen rahatsız etmek ve sosyal istikrarın altını çizmek;
 (7) müstehcenlik, pornografi, kumar, şiddet, terör veya muayene suçu yaymak;
 (8) başkalarına hakaret etmek veya iftira etmek, başkalarının yasal haklarını ve çıkarlarını ihlal etmek;
 (9) Yasadışı meclis, dernekler, işleme, gösteriler, sosyal düzeni bozmak için kalabalık toplama teşvik etmek;
 (10) Yasadışı bir sivil örgütün adına etki etmek;
 (11) "Anlık Mesajlaşma Araçları için Kamu Bilgi Hizmet Hizmetlerinin Geliştirilmesi ve Yönetimi" nin "Geçici Hükümler" nin karşısına uymayanlar ve "yedi alt satır" gereklilikleri, sosyalist sistem, ulusal çıkarlar, yasal Vatandaşların, kamu düzeni, sosyal ahlak ve bilgi orijinalliği vb. İlgi alanları;
 (12) Yasalar ve idari düzenlemeler tarafından yasaklanan diğer içeriği içeren.
5. Yasalara, düzenlemelere ve platform gereksinimlerine uymayan diğer içerikler

#cfa7a0f Müzik Yönetimi Fonksiyonu Hakkında #N
-Bir online oyunlar, sadece ana bilgisayar veya sunucu, duraklat, sonraki şarkı, şarkı, vb. Gibi müzik çalarda yönetim işlemlerini kullanma yetkisine sahiptir;

#cfa7a0f Talep üzerine oynanabilecek müzik içeriği hakkında #n
- Zaman için, QQ Music tarafından yetkilendirilen şarkıların yalnızca bazıları desteklenir. Şu anda, talep üzerine daha fazla şarkı izni için çabalıyoruz, bu yüzden ayarlandı;

#cfa7a0f Online Mode #N'de İsteğe Bağlı Kısıtlamalar Hakkında
-Arkta oynanan listede zımpar kazanın, talep üzerine tekrar tekrar eklenemez;
-Non-ev sahipleri aynı anda sadece bekleme listesine üç şarkı ekleyebilir. Üst sınıra ulaştıktan sonra, onları yeniden sipariş edemeden önce ev sahibi tarafından bitirmek veya silmek için sipariş edilen şarkıları beklemeleri gerekir;

#cfa7a0f Müzik Oynatma Modu #N Hakkında
-Queue Play: Oyun kuyruğunun sırasına göre oynayın ve şarkı çalındıktan sonra kuyruktan çıkarılacaktır.
-Ooop Oyna: Oyun kuyruğunun sırasına göre oynayın ve şarkı oynadıktan sonra bekleme listesinde kalacaktır.

#cfa7a0f tam çalma işlevi hakkında #N
- Açıldığında, oyunda tüm oyuncular oyun kuyruğuna şarkı ekleyebilir.
- Kapalıyken, sadece oyundaki ana bilgisayar veya sunucu, oyun kuyruğuna şarkı ekleyebilir.

1. Maceracılar, çeşitli oyun eylemlerini tamamladıklarında sürpriz bir hediye paketi tetikleme fırsatı vardır;
2. Her tetiklenen olay hediye paketi yalnızca bir kez satın alınabilir ve hediye paketi satın alma işlemi tamamlandıktan sonra kaybolur;
3. Her sürpriz hediye paketi ayrı bir geri sayım sayacı vardır. Geri sayımdan sonra, hediye paketi kaybolur. Kaçırmayın, her maceracı!

1. Etkinliğe katılan oyuncular, alışveriş merkezindeki bazı kostümlerde sınırlı süreli indirimlere sahip olacaklar;
 2. Etkinlik bittikten sonra indirimli skin elbise orijinal fiyatından satılacaktır, fırsat kaçırılmamalıdır;
 3. Gelecekte daha heyecan verici avantajlar açılacak, bu yüzden bizi izlemeye devam edin!

Sol düğme seçildi: Ana öğe değiştiğinde, çocuk elemanı ile ana öğenin sol sınırı arasındaki mesafe değişmez;
- Sağdaki düğme seçilir: Ana öğe değiştiğinde, çocuk elemanı ile ana öğenin sağ sınırı arasındaki mesafe değişmez;
-Upper düğmesi seçilidir: Ebeveyn elemanı değiştiğinde, çocuk elemanı ile ebeveyn elemanının üst sınırının arasındaki mesafe değişmez;
-The alt düğmesi seçilir: Ebeveyn elemanı değiştiğinde, çocuk elemanı ile ana öğenin alt sınırı arasındaki mesafe değişmez;
- Sol ve sağ düğmeler aynı anda seçilir: Ebeveyn elemanı değiştiğinde, çocuk elemanı ile ana öğenin orta noktası arasındaki yatay mesafe değişmez;
-UP ve AŞAĞI düğmeleri aynı anda seçilir: Ebeveyn elemanı değiştiğinde, çocuk elemanı ile ana öğenin orta noktası arasındaki dikey mesafe değişmez;
